package lecture1;

import java.util.Scanner;

public class oddoreven {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scn=new Scanner(System.in);
		int N=scn.nextInt();
      if(N%2==0){
    	  System.out.println("Prime");
      }
		
      else{
    	  System.out.println("Not Prime");
      }
	   

	}

}
